//{fav}는 Food의 object
function Food({fav}){
  return <h3>I love {fav}</h3>;
}

//JSX = Javascript + HTML
//index.html로 뿌리지 않고 component로 접근하기 때문에 속도 증가
function App() { 
  return (
    <div className="App">
      <Food fav="cake" />
      <Food fav="ramen" />
      <Food fav="gogi" />
      <Food fav="gooksu" />
    </div>
  );
}

export default App;
